import React from "react";
import Title from "../components/title";

const About = () => {
  return (
    <div className='inner'>
      <div class="content-div">
        <div class="about-container">

        <Title lineContent='Sobre'/>
        <p>
        Engenheiro de Software com graduação prevista para dezembro de 2020. Desenvolvo aplicações web desde 2016.
        Tenho interesse em desenvolvimento de sistemas, ciência de dados, inteligência artificial e desenvolvimentos de
        jogos.
        </p>
        <Title lineContent='Eduacação'/>



        <Title lineContent='Competência'/>
        Senado Federal Brasília, DF
        ESTAGIÁRIO EM DESENVOLVIMENTO WEB Fev. 2019 - Atualmente
        • Sobre o senado: O Senado Federal é a câmara alta do Congresso Nacional do Brasil e, ao lado da Câmara dos Deputados, faz parte do Poder
      Legislativo da União.
        • Papel desempenhado: Desenvolvedor de aplicações web que contribuem para a transparência e o bom funcionamento do poder legislativo no Brasil.
        <Title lineContent='Competência'/>
        <Title lineContent='Projetos'/>
        <Title lineContent='Certificados'/>
        </div>
      </div>
    </div>
  );
};

export default About;
